		"<b>採用職業選手意見設計而成</b>\n\nPR-S系列的頂尖系列，與成套的車衣互相搭配。利用經過多次測試的特殊科技布料，車褲穿起來滑順且符合人體工學，不影響運動時的靈活度和舒適度。\n\n運用擁有優秀彈力的Zaffiro布料，產生絕佳的壓縮與肌肉支撐。Alé獨家的Leg Comfort System，使騎士在座墊上踩踏時布料自然的貼合大腿以及臀部，並在末端加入直接切割而成的S-Stability System布料，具有極輕量的矽膠材質，確保不會在活動時出現皺褶或位移，同時有利於空氣力學。\n\n設計簡潔且柔軟的吊帶，不管是變換騎姿或加速進攻都能穩定地與身體結合，在背後採用具有透氣孔的光滑布料，有效的加速身體後側的散熱。最後加入一點反光元素，讓這件車褲每個細節都無懈可擊。",
