		"<br><hr>\n<b>4H 護墊介紹：</b>\n<ul>\n<li>主墊由彈性微纖維製成，在接觸點巧妙的緩衝，會陰和坐骨使用 90kg/m<sup>3</sup>密度的襯墊，整塊褲墊經過校準且完全透氣，能防止來自道路的衝擊與壓力。</li>\n<li>副墊根據人體解剖結構設計，60kg/m<sup>3</sup> 的密度設計讓踩踏時可靈活的隨身體運動，提供最優秀的舒適度。</li>\n</ul>",
