		"<b>專為職業自行車選手所設計</b>\n\n這款旗艦的PR-S車衣是專為職業自行車選手所設計，與諸多職業車隊合作，透過分析精英車手的騎姿來實現終極的空氣力學。當比賽的成敗只差幾分之一秒時，每個細節都能影響勝負。\n\nAlé的Body Mapping技術能夠將布料製作出最適合各個部位的形狀，因此這件車衣會如同第二層皮膚般貼合。主要採用抗靜電的Rap Dry Carbon布料以及極輕量的Micro Aero布料，在手臂、軀幹兩側加入網眼Piuma布料，讓空氣能夠滑順的通過身體並同時使車衣加速乾燥，卓越的透氣性與輕量化帶來一流的舒適感。\n\n為了滿足競賽的需求，車衣正面使用我們知名的J-Stability System構造，確保您在將自己推往極限時車衣能夠穩固的貼在身體上，精心設計的內縮式袖子進一步強化空氣力學優勢，袖口用雷射切割輕量的S-Stability System矽膠止滑，最後在車衣背後下方的內側加入彈性矽膠，使車衣與車褲能完美貼合。",
